import React from "react";
import { Route,  Routes,  BrowserRouter,} from "react-router-dom";

import Home from "../Pages/Home/Home";
function ReactRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/"><Home/></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default ReactRoutes;
